import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
          <Header/>
        <header className="">
          <h1>Caloteiro</h1>
        </header>
      </div>
    );
  }
}


class Header extends Component{
  render(){

    return(


      <nav class="navbar navbar-light bg-light">
      <span class="navbar-brand mb-0 h1">Navbar</span>
    </nav>




    );

  }


}


export default App;
